window.bookSummaryJSON = "<p>un路fath路om路a路ble<br> 1. incapable of being fully explored or understood.<br> ...<br> Synonyms: inscrutable, incomprehensible, enigmatic, indecipherable, impenetrable, obscure, esoteric, mysterious, mystifying, deep, profound<br> \"unfathomable mysteries\"<br> 2. (of water or a natural feature) impossible to measure the extent of.</p> <p>To most people, the definition above is just a word expressing similar definitions and nothing more. But when a bizarre sequence of events draws not only the United States but every world superpower on the globe into the threat of World War III, the word takes on a whole new meaning. The president is missing.... And all the world can do at this point is watch as the horror and mystery slowly begin to unravel, revealing the <i>Unfathomable</i>.&nbsp;&nbsp;</p>"; 
